import React from "react";
import loginImg from '../assets/OIP.jpg'
const SignIn = ()=>{
    return(
        <div className='grid grid-cols-l sm:grid-cols-2'>
            <div>
                <img src={loginImg} alt="" />
            </div>

        </div>
    );
}
export default SignIn;
